    basis[10] = SH_C3_2 * y * (4.0 * zz - xx - yy);
    basis[11] = SH_C3_3 * z * (2.0 * zz - 3.0 * xx - 3.0 * yy);
    basis[12] = SH_C3_4 * x * (4.0 * zz - xx - yy);
